    public function getSourceContext()
    {
        return new Source("<!DOCTYPE html>
<html lang=\"fr\">
    <head>
        <meta charset=\"UTF-8\">
        <title>{% block title %}NOM SITE{% endblock %}</title>

        {% block stylesheets %}
            <link href=\"{{ asset('CSS/style.css') }}\" rel=\"stylesheet\" >
        {% endblock %}

        {% block javascripts %}

        {% endblock %}
    </head>

    <body>
        <header class=\"header\">
            {% block header %}
                <nav class=\"nav\">
                    <label class=\"label\">NOM</label>
                    <ul>
                        {% if not app.user %}
                            <li class=\"nav-item\">
                                <a href=\"{{ path('security_login') }}\" class=\"nav-link\">Connexion</a>
                            </li>
                            <li><a href=\"{{ path('security_registration') }}\">Inscription</a></li>
                        {% else %}
                            {% for roles in app.user.roles %}
                                {% if roles == \"ROLE_ADMIN\" %}
                                    <li class=\"nav-item\">
                                        <a href=\"{{ path('admin_users') }}\" class=\"nav-link\">Administration</a>
                                    </li>
                                {% endif %}
                            {% endfor %}
                            <li class=\"nav-item\">
                                <a href=\"{{ path('security_logout') }}\" class=\"nav-link\">Déconnexion</a>
                            </li>
                        {% endif %}

                    </ul>
                </nav>
            {% endblock %}
        </header>
        <div class=\"vue\">
            {% block body %}
                <h1>
                    {% block titre_principal %}

                    {% endblock %}
                </h1>
                {% block vue %}

                {% endblock %}
            {% endblock %}
        </div>
        <footer class=\"footer\">
            {% block footer %}

            {% endblock %}

        </footer>
    </body>
</html>
", "base.html.twig", "C:\\wamp64\\www\\projet\\templates\\base.html.twig");
    }
